package com.martin.entity;import java.io.Serializable;/** * 消费者服务 **/public class ConsumerService implements Serializable {    private static final long serialVersionUID = 132456L;    /**     * 服务接口     **/    private Class<?> serviceInterface;    /**     * 消费者的 IP     **/    private String conumserIp;    /**     * 消费者的端口号     **/    private int port;    /**     * 分组名     */    private String groupName;    /**     * 消费者调用的超时时间     **/    private long timeout;    public Class<?> getServiceInterface() {        return serviceInterface;    }    public void setServiceInterface(Class<?> serviceInterface) {        this.serviceInterface = serviceInterface;    }    public String getConumserIp() {        return conumserIp;    }    public void setConumserIp(String conumserIp) {        this.conumserIp = conumserIp;    }    public int getPort() {        return port;    }    public void setPort(int port) {        this.port = port;    }    public long getTimeout() {        return timeout;    }    public void setTimeout(long timeout) {        this.timeout = timeout;    }    public String getGroupName() {        return groupName;    }    public void setGroupName(String groupName) {        this.groupName = groupName;    }    @Override    public String toString() {        return "ConsumerService{" +                "serviceInterface=" + serviceInterface +                ", conumserIp='" + conumserIp + '\'' +                ", port=" + port +                ", groupName='" + groupName + '\'' +                ", timeout=" + timeout +                '}';    }}